const mongoose = require('mongoose');

// Defining the model schema for musicart members 
const itemModel = mongoose.model('Items', {
    mainImage: String,
    subImage: {
        sub1 : String,
        sub2 : String,
        sub3 : String
    },
    ilongtitle: String,
    ititle: String, 
    iprice: Number,
    icolor: String,
    itype: String,
    idesc: String,
    stock: Boolean,
    ibrand: String
});

module.exports = itemModel;



